import React from 'react';

const UserPage = () => {
    return (
        <div className='UserPage-container'>
            <h1>Welcome, Jake!</h1>
            <ul>Your bucket list:
                <li>Walk the dog</li>
                <li>Wash the dishes</li>
                <li>Mow the lawn</li>
                <li>Pay rent</li>
            </ul>
        </div>
    );
}

export default UserPage;
